module.exports = "<h1 id=\"account\">Account</h1>\n<p>An account is identified by its public address on the network. It is totally fine to give away this address, this is also the only information needed to receive funds. The network will <strong>not</strong> know about the name you give to this account in this application.</p>\n<h1 id=\"balances\">Balances</h1>\n<p>The balances for each account is broken down into a number of areas, giving an overview of the totals, transferable and bonded funds as well as the funds currently being unbonded or redeemable. These are -</p>\n<ul>\n<li><strong>total</strong>: The overall amount of funds in the account, this includes the vested balance, available for transfer and locked.</li>\n<li><strong>available</strong>: The funds that can be transferred or bonded, i.e. the funds that are available for any transaction.</li>\n<li><strong>bonded</strong>: The funds bonded for validating or nominating. They are locked and cannot be transferred, although it can be unlocked for future actions.</li>\n<li><strong>redeemable</strong>: The funds that can get redeemed, e.g made available for withdrawal, by clicking on the &quot;lock&quot; icon.</li>\n<li><strong>unbonding</strong>: The funds that are being unbonded. The funds will be redeemable after the bonding period has passed. These funds can still be slashed. The information icon tells the amount of blocks left before the funds can be redeemed.</li>\n</ul>\n<h1 id=\"security\">Security</h1>\n<p>The public address is generated from a private key, itself generated from a seed or a mnemonic phrase. The seed or the mnemonic phrase should <strong>never be shared with anybody</strong> as they give access to your funds. It must be stored securely.\nThe password needed to create an account is used to encrypt your private key. You must choose a strong and unique password.\nThis password is also used to encrypt the private key in the backup file downloaded upon account creation. Thanks to this file together with your account password, you can recover your account.</p>\n<h1 id=\"account-recovery\">Account recovery</h1>\n<p>You can recover an account from its:</p>\n<ul>\n<li><p>seed or mnemonic:\nClick on the &quot;Add account&quot; button, type your seed or mnemonic in the associated field.</p>\n</li>\n<li><p>backup file (also called JSON keystore file) and the account&#39;s password:\nClick on &quot;Restore JSON&quot; button. Upload your backup file and type in the password associated.</p>\n</li>\n</ul>\n<h1 id=\"minimum-allowed-balance\">Minimum allowed balance</h1>\n<p>Accounts with a balance lower than the minimal amount, 100 milliUnits (miliDOTs for Polkadot) as of writing are considered as nonexistent for the network. If an account&#39;s balance ever drops below this amount, it is removed from the network. In this application, it will still be visible, but with a balance of 0.</p>\n<p>For a fund transfer to a <strong>new account</strong> (read an account with a balance of 0), if the amount transferred is less than the minimum allowed balance, then the transfer will &quot;succeed&quot; but the destination account will not be created (read its balance will remain 0); this essentially burns the transfer balance from the sender, because the receiver&#39;s balance never exceed the minimum allowed balance.</p>\n<p>If the receiver already exists (read it has a balance greater than 0), it is perfectly possible to transfer very low amounts.</p>\n<h1 id=\"cryptography\">Cryptography</h1>\n<p>Substrate and Polkadot use Schnorrkel/Ristretto x25519 (&quot;sr25519&quot;) as its key derivation and signing algorithm.</p>\n<p>Sr25519 is based on the same underlying Curve25519 as its EdDSA counterpart, Ed25519. However, it uses Schnorr signatures instead of the EdDSA scheme. Schnorr signatures bring some noticeable benefits over the ECDSA/EdDSA schemes. For one, it is more efficient and still retains the same feature set and security assumptions. Additionally, it allows for native multisignature through signature aggregation.</p>\n<p>If you wish to validate, the <code>session</code> account needs to use &quot;ed25519&quot; cryptography.</p>\n";

