module.exports = "<h1 id=\"contracts\">contracts</h1>\n<p>This contract management interface allows you to deploy WASM code for contracts, deploy contracts based on on-chain code and allows you to interact with contracts by sending messages.</p>\n<h2 id=\"warning\">warning</h2>\n<p>Please be aware that this interface is very new and has not been thoroughly tested against all kinds of combinations of inputs - there are no doubt bugs lurking inside these sections. Additionally, the substrate contracts ABI is a very recent addition, and while stabilizing there may be changes and or-breakages while using this UI to interact.</p>\n<p>With all that said - if you do find issues, please log them.</p>\n<h2 id=\"basic-operations\">basic operations</h2>\n<p>The interface has 3 main areas -</p>\n<ul>\n<li><strong>Code</strong> This allows you to deploy WASM code on-chain or attach on-chain code into your local registry. Each code blob is identified by a unique hash, when deploying this will be saved, when attaching you would need to know the unique hash. From these bundles you can then move to the next step,</li>\n<li><strong>Instance</strong> This allows you to create contract instances using on-chain WASM code. Select the code to use, attach the ABI, specify the contract values and the contract can be deployed. As with the Code section, you can also attach on-chain instances when you know the address.</li>\n<li><strong>Call</strong> This allows you to send messages to contracts, via the address and attached ABIs.</li>\n</ul>\n";

